import React from "react";
import EnvTu from "./components/EnvTu";
import EnvTi from "./components/EnvTi";
import EnvHo from "./components/EnvHo";
import Navbar from "./components/layout/Navbar";
import Footer from "./components/layout/Footer";

import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";

function App() {
  return (
    <Router>
      <Navbar />
      <Switch>
        <Route exact path="/">
          <Home />
        </Route>
        <Route path="/qmgr/tu">
          <EnvTu />
        </Route>
        <Route path="/qmgr/ti">
          <EnvTi />
        </Route>
        <Route path="/qmgr/ho">
          <EnvHo />
        </Route>
      </Switch>
      <Footer />
    </Router>
  );
}

function Home(){
  return <h1>Home</h1>
}

export default App
